    // A button will call this function
    //
    function capturePhotoWithData() {
      // Take picture using device camera and retrieve image as base64-encoded string
      navigator.camera.getPicture(onPhotoDataSuccess, onFail, 
          { 
            allowEdit: false,
            quality: 50,
            targetWidth: 400, 
            destinationType: Camera.DestinationType.DATA_URL,
            encodingType: Camera.EncodingType.PNG }
        );
    }      
    
    // A button will call this function
    //
    function getPhoto(source) {
      // Retrieve image file location from specified source
      navigator.camera.getPicture(onPhotoDataSuccess, onFail, { 
        quality: 20,
        targetWidth: 200, 
        destinationType: destinationType.DATA_URL,
        sourceType: source });
    }

    // Called if something bad happens.
    // 
    function onFail(err) {
      var output = document.getElementById('output');
      output.style.display = 'block';
      output.innerHTML = JSON.stringify(err);
      console.error(err);
    }          
    
    function ocrAPI(b64encoded) {           
      if (b64encoded === undefined)
        b64encoded = jpgB64;                           
      
      $.ajax({          
           url: 'http://demoapi.smk.dk:8088/api/proto/ocr/',
           beforeSend: function(xhrObj){
            // Request headers
            xhrObj.setRequestHeader("Content-Type","application/octet-stream");            
          },
          type: 'POST',
          
          //contentType: 'application/json',
          //data:'{"url":"http://durer.smk.dk/images/smk.png"}'
          
          //contentType: 'application/octet-stream',          
          processData: false,
          data: b64encoded
          //data: {"url": b64encoded}
       })
      .done(function(solrresponse) {                            
        console.log(JSON.stringify(solrresponse));
        if(solrresponse.response.numFound > 0 && solrresponse.response.docs[0].id !== undefined ){
          displayImage(solrresponse.response.docs[0].id);
        }else{          
          onFail('ocr gave no results');
        }                
      })
      .fail(function(err) {
        onFail(err);  
      });
    }    
    
    